const ChatStepContainer = styled.View`
  background-color: #fff;
  border-radius: 5;
  border-width: 1;
  border-color: #ddd;
  margin-right: 6;
  margin-bottom: 10;
  margin-left: 6;
  padding-top: 16;
  padding-right: 16;
  padding-bottom: 16;
  padding-left: 16;
`;

